import { Button } from './components/Button/Button';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Button 
          title={'Сохранить'}
          color={'gray'}
          intensity={600}
          size
        />
      </header>
    </div>
  );
}

export default App;
